import Navbar from 'react-bootstrap/Navbar';

import logo from '../logo.png'

function App () {
    return(
        <Container>
            <Navbar>
                <NavbarBrand href="#">DApp ICO Crowdsale</NavbarBrand>
            </Navbar>
        </Container>
    )
}

export default App;
